(1, 1, '2015-03-01 19:14:56', '2015-03-01 19:14:56', 'testes Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non  mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.', 'Duis sed odio sit amet nibh vulputate cursus', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2015-03-06 13:41:06', '2015-03-06 13:41:06', '', 0, 'http://localhost/practice/wordpress_theme_dev/?p=1', 0, 'post', '', 4),
(2, 1, '2015-03-01 19:14:56', '2015-03-01 19:14:56', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/practice/wordpress_theme_dev/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2015-03-01 19:14:56', '2015-03-01 19:14:56', '', 0, 'http://localhost/practice/wordpress_theme_dev/?page_id=2', 0, 'page', '', 0),
